import * as React from "react";
import { Navigate, Route, Routes } from "react-router-dom";
import Home from "../components/Home";
import Login from "../components/Login";
import Register from "../components/Register";
import Post from "../components/post/Post";
import Edit from "../components/post/Edit";
import Create from "../components/post/Create";
import PrivateRoute from "../components/auth/PrivateRoute";
import RestrictedRoute from "../components/auth/RestrictedRoute";

export const AppRoutes = () => {
  return (
    <Routes>
      <Route path={"/"} element={<Home/>} />
      <RestrictedRoute path={"/login"} element={<Login/>} />
      <RestrictedRoute path={"/register"} element={<Register/>} />
      <PrivateRoute path={"/post/:postId"} element={<Post/>}/>
      <PrivateRoute path={"/post/edit/:postId"} element={<Edit/>}/>
      <PrivateRoute path={"/post/create"} element={<Create/>} />
      <Route
          path="*"
          element={<Navigate to="/" replace />}
      />
    </Routes>
   );
}
